import React, {Component} from 'react';
import TweetsSingle from './TweetsSingle';

class Tweets extends Component {

    constructor(props) {
        super(props);
        this.state = {
            tweets: [],
        };
    }

    componentDidMount() {
        const url = 'https://api.twitter.com/2/tweets/search/recent?query=facialrecognition';
        fetch(url)
            .then((response) => {
                return response.json();
            })
            .then((data) => {
                this.setState({
                    tweets: data.data
                })
            })
            .catch((error) => console.log(error));
    }

    renderItems() {
        return this.state.tweets.map((item) => (
            <TweetsSingle key={item.id} item={item} />
        ));
    }

    render() {
        return(
            <ul>
                {this.renderItems()}
            </ul>
        );
    }
}

export default Tweets;
